package com.jsh.myproject.dto;

public class infoDto {

	private String china;
	private String english;
	private String home;
	private String email;
	private String bank;
	private String account;
	private String depositor;
	private String nation;
	private String professor;
	private String year;
	
	
	
	public infoDto() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	
	public infoDto(String china, String english, String home, String email, String bank, String account,
			String depositor, String nation, String professor, String year) {
		super();
		this.china = china;
		this.english = english;
		this.home = home;
		this.email = email;
		this.bank = bank;
		this.account = account;
		this.depositor = depositor;
		this.nation = nation;
		this.professor = professor;
		this.year = year;
	}
	public String getChina() {
		return china;
	}
	public void setChina(String china) {
		this.china = china;
	}
	public String getEnglish() {
		return english;
	}
	public void setEnglish(String english) {
		this.english = english;
	}
	public String getHome() {
		return home;
	}
	public void setHome(String home) {
		this.home = home;
	}
	public String getEmail() {
		return email;
	}
	public void setEmail(String email) {
		this.email = email;
	}
	public String getBank() {
		return bank;
	}
	public void setBank(String bank) {
		this.bank = bank;
	}
	public String getAccount() {
		return account;
	}
	public void setAccount(String account) {
		this.account = account;
	}
	public String getDepositor() {
		return depositor;
	}
	public void setDepositor(String depositor) {
		this.depositor = depositor;
	}
	public String getNation() {
		return nation;
	}
	public void setNation(String nation) {
		this.nation = nation;
	}
	public String getProfessor() {
		return professor;
	}
	public void setProfessor(String professor) {
		this.professor = professor;
	}
	public String getYear() {
		return year;
	}
	public void setYear(String year) {
		this.year = year;
	}
	
	
	
}
